INSERT INTO dieta VALUES (3376,1437,937,2,"Sera: (un piatto solo al massimo) minestre sopra tutto di verdura con, semolini, tapioca, riso, od in mancanza riso o pastina semi integrale; meglio le altre soluzioni.¬†Oppure in sostituzione, pesce e/o carne alla griglia con verdure cotte¬† o crude,¬† insalate verdi non crude perche' possono provocare insonnia.",8113);
