INSERT INTO dieta VALUES (3446,1577,1077,4,"Mezzo giorno: aprire il pasto con un bel piatto di verdure crude di tutti i tipi in abbondanza con frutta in insalata (meglio senza olio, se lo si desidera, utilizzarne pochissime quantit√† - un cucchiaino al massimo e variando ad ogni pasto il tipo di vegetale dal quale proviene l‚Äôolio).",8017);
INSERT INTO dieta VALUES (3447,2632,2132,3,"Pomeriggio: frutta di stagione o infusi di erbe (non eccitanti) addolciti con miele, con qualche biscotto, pochissimi; se si desidera cibo salato, fare attenzione alla quantita' ed al tipo.",8100);
